import logo from './public/Rowan-Morrison-logo-02.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="rowan-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
